import React from "react";
import styled from "styled-components";

const Main = () => {
  return (
    <React.Fragment>
      <DIV>
        <H1>
          당신 근처의
          <br />
          당근마켓
        </H1>
        <P>
          중고 거래부터 동네 정보까지, 이웃과 함께 해요
          <br />
          가깝고 따뜻한 당신의 근처를 만들어요.
        </P>
        <div>이미지</div>
      </DIV>
    </React.Fragment>
  );
};

export default Main;

const DIV = styled.div`
  width: 1024px;
  height: 760px;
  margin: 0 auto;
  position: relative;
  background-color: #fbf7f2;
`;

const H1 = styled.h1`
  font-size: 3.2rem;
  line-height: 1.3;
  padding-top: 16rem;
  margin-bottom: 2rem;
  letter-spacing: -0.4px;
  font-weight: 700px;
`;

const P = styled.p`
  font-size: 17px;
  display: block;
  margin-block-start: 1em;
  margin-block-end: 1em;
  margin-inline-start: 0px;
  margin-inline-end: 0px;
`;

const Image = styled.div`
  position: absolute;
  right: -84px;
  bottom: 0;
  width: 804px;
  height: 685px;
  background: #fbf7f2
    url(https://d1unjqcospf8gs.cloudfront.net/assets/home/main/3x/image-top-4eb6b86….png)
    no-repeat;
  background-size: 804px 685px;
`;
